INSERT INTO `mdl_notifications` VALUES (1,2,2,'Moodle updates are available (http://127.0.0.1:80)','Update notifications\n\nThere is a newer Moodle version available!\nMoodle 3.9+ (Build: 20200704) Version 2020061500.04 (Stable version)\nMoodle 3.8.3+ (Build: 20200704) Version 2019111803.16 (Stable version)\n\nSee http://127.0.0.1:80/admin/index.php for more details\n\nIt is strongly recommended that you update your site to the latest version to obtain all recent security and bug fixes.\n\nYour Moodle site http://127.0.0.1:80 is configured to automatically check for available updates. You are receiving this message as the administrator of the site. You can disable automatic checks for available updates in Site administration / Server / Update notifications or customise the delivery of this message via your preferences page.\n',2,'<h1>Update notifications</h1>\n<h2>There is a newer Moodle version available!</h2>\n<ul>\n<li><strong>Moodle 3.9+ (Build: 20200704)</strong> Version 2020061500.04 (Stable version)</li>\n<li><strong>Moodle 3.8.3+ (Build: 20200704)</strong> Version 2019111803.16 (Stable version)</li>\n</ul>\n<p>See <a href=\"http://127.0.0.1:80/admin/index.php\">http://127.0.0.1:80/admin/index.php</a> for more details</p>\n<p>It is strongly recommended that you update your site to the latest version to obtain all recent security and bug fixes.</p>\n<footer><p style=\"font-size:smaller; color:#333;\">Your Moodle site <a href=\"http://127.0.0.1:80\">http://127.0.0.1:80</a> is configured to automatically check for available updates. You are receiving this message as the administrator of the site. You can disable automatic checks for available updates in Site administration / Server / Update notifications or customise the delivery of this message via your preferences page.</p></footer>','Update notifications','moodle','availableupdate',NULL,NULL,NULL,1594209623,NULL);
/*!40000 ALTER TABLE `mdl_notifications` ENABLE KEYS */;
UNLOCK TABLES;

